                color:black;
                background:#FFF;
                transition: 0s ease-out;
            }

            .navbar ul li::before {
                position:absolute;
                content:attr(text-data);
                padding: 8px 12px;
                background:#fff;
                color:#333;
                font-weight:500;
                top: 50%;
                left:50px;
                transform: translateX(10px) translateY(-30%);
                border-radius:8px;
                text-transform:capitalize;
                opacity: 0;
                visibility: hidden;
                z-index: 9999;
            }
            .navbar ul li::after {
                position:absolute;
                content:'';
                left:20px;
                top:50%;
                transform: translateX(30px) translateY(-50%);
                opacity: 0;
                visibility: hidden;
            }
            .navbar ul li:hover::before,
            .navbar ul li:hover::after {
                transform: translateX(0px) translateY(-30%);
                opacity: 1;
                visibility: visible;
                transition: 0.15s ease-out;
            }

